import React from 'react';
import { motion } from 'framer-motion';

const HomePage = () => (
  <motion.div 
    className="home fade-in"
    initial={{ opacity: 0 }}
    animate={{ opacity: 1 }}
    exit={{ opacity: 0 }}
  >
    <h1>Welcome to Property Management E-Mall</h1>
    <p>Find your dream property here!</p>
  </motion.div>
);

export default HomePage;
